import './App.css';
import Leadmap from './map.js'


function App() {
  return (
    <div className="App">
      <p></p>
      <div>
          <form action="http://localhost:3000/" method="get">
            <input type="text" id="adrs" placeholder= "Street Address..." name="adrssearch"/>
            <input type="text" id="city" placeholder= "City..." name="citysearch"/>
            <button onClick={this.howItWorks} type="button" className='btn'>How it Works</button>
            howItWorks = () => {
              window.GetAPI()
            };
          </form>
            
      </div>
      <p></p>
      <div className="col-sm-4">
        <div className="container">
          <form action="http://localhost:5000/" method="put">
          <h1 name='water' id='water'></h1>
          </form>
        </div>
      </div>
      <Leadmap></Leadmap>
    </div>
  );
}

export default App;
